```typescript
import * as fs from 'fs';
import * as readline from 'readline';

interface CSVRow {
  [key: string]: string;
}

class CSVParser {
  private delimiter: string;

  constructor(delimiter: string = ',') {
    this.delimiter = delimiter;
  }

  public async parseFile(filePath: string): Promise<CSVRow[]> {
    const fileStream = fs.createReadStream(filePath);
    const rl = readline.createInterface({
      input: fileStream,
      crlfDelay: Infinity
    });

    const rows: CSVRow[] = [];
    let headers: string[] | null = null;

    for await (const line of rl) {
      if (!line.trim()) continue; // Skip empty lines

      const values = line.split(this.delimiter);

      if (!headers) {
        headers = values;
      } else {
        if (values.length !== headers.length) {
          throw new Error('Malformed CSV: Row length does not match header length');
        }

        const row: CSVRow = {};
        headers.forEach((header, index) => {
          row[header] = values[index];
        });

        rows.push(row);
      }
    }

    if (!headers) {
      throw new Error('Empty CSV file');
    }

    return rows;
  }
}

// Example usage
(async () => {
  const parser = new CSVParser();
  try {
    const rows = await parser.parseFile('path/to/your.csv');
    console.log(rows);
  } catch (error) {
    console.error('Error parsing CSV:', error.message);
  }
})();
```

