- **Interface Definition**: `CSVRow` is defined as an object with string keys and values.
- **CSV Parsing Logic**: The `CSVParser` class reads a CSV file line by line using Node.js streams and the `readline` module.
- **Validation**: Checks if the CSV is empty or if any row has a different number of columns than the header.
- **Edge Cases**: Handles empty files by throwing an error and checks for malformed CSV data by comparing the number of columns in each row to the header.

### Edge Cases Addressed:

1. **Empty File**: Throws an error if the CSV file is empty.
2. **Malformed CSV**: Throws an error if any row has a different number of columns than the header row.

