```typescript
import fs from 'fs';
import csv from 'csv-parser';
import { Strategy, AggregationResult } from './interfaces';

export class StatsAggregator {
  private strategies: Strategy[] = [];

  public loadCSV(filePath: string): Promise<void> {
    return new Promise((resolve, reject) => {
      if (!fs.existsSync(filePath)) {
        return reject(new Error('File does not exist'));
      }

      const results: Strategy[] = [];
      fs.createReadStream(filePath)
        .pipe(csv())
        .on('data', (data) => {
          try {
            const strategyName = data['strategy'];
            const value = parseFloat(data['value']);
            if (!isNaN(value)) {
              let strategy = results.find(s => s.name === strategyName);
              if (!strategy) {
                strategy = { name: strategyName, data: [] };
                results.push(strategy);
              }
              strategy.data.push(value);
            }
          } catch (error) {
            console.error('Malformed CSV data:', error);
          }
        })
        .on('end', () => {
          this.strategies = results;
          resolve();
        })
        .on('error', (error) => {
          reject(error);
        });
    });
  }

  public aggregate(): AggregationResult[] {
    return this.strategies.map(strategy => {
      const total = strategy.data.reduce((sum, value) => sum + value, 0);
      const count = strategy.data.length;
      const average = count > 0 ? total / count : 0;
      return {
        strategyName: strategy.name,
        total,
        average,
        count
      };
    });
  }

  public toJSON(): string {
    return JSON.stringify(this.aggregate(), null, 2);
  }
}
```

